from fastapi import APIRouter
from ..util.reading_models import PassageRqst, Content, Word


router = APIRouter()

@router.get('/')
def get_reading():
    return {'reading': 'reading'}

@router.post('/passage')
def create_reading(reading: PassageRqst):
    words = [
        Word(word='Hair', imageURL='data:image/jpeg;base64,'),
        Word(word='Base', imageURL='data:image/jpeg;base64,'),
        Word(word='Apple', imageURL='data:image/jpeg;base64,'),
        Word(word='Book', imageURL='data:image/jpeg;base64,'),
    ]
    passage = Content(passage=words, focusWordsIndex=[1, 3])
    return passage
